import { useSelector } from "react-redux";

const CartList = () => {
  const cartList = useSelector((state) => state.cart.cartList);

  return (
    <>
      <div>
        <h2>Shopping Cart</h2>
        <></>
      </div>
    </>
  );
};

export default CartList;
